using Aspose.Slides;
using Aspose.Slides.Export;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.Logging;
using System;
using System.Collections.Generic;
using System.Drawing;
using System.IO;
using System.Linq;
using System.Threading.Tasks;
using System.Net;

namespace pptExport.Controllers
{
    [ApiController]
    [Route("[controller]")]
    public class WeatherForecastController : ControllerBase
    {
        private static readonly string[] Summaries = new[]
        {
            "Freezing", "Bracing", "Chilly", "Cool", "Mild", "Warm", "Balmy", "Hot", "Sweltering", "Scorching"
        };

        private readonly ILogger<WeatherForecastController> _logger;

        public WeatherForecastController(ILogger<WeatherForecastController> logger)
        {
            _logger = logger;
        }

        public Image LoadImage(string s)
        {
            //data:image/gif;base64,

            byte[] bytes = Convert.FromBase64String(s);

            Image image;
            using (MemoryStream ms = new MemoryStream(bytes))
            {
                image = Image.FromStream(ms);
            }

            return image;
        }

        [HttpGet]
        public IEnumerable<WeatherForecast> Get()
        {

            string path = "C:\\Users\\91731\\Desktop\\outAsposeSlides.pptx";
            string[] dataArray = {
                "",
                "",
                ""
            };

            Presentation pres = new Presentation();
            ISlide sld;
            float currentHeight = pres.SlideSize.Size.Height;
            float currentWidth = pres.SlideSize.Size.Width;

            double ratio = 1.25;
            int heightImg = Convert.ToInt32(currentHeight / ratio);
            int widthImg = Convert.ToInt32(currentWidth / ratio);
            
            int startWidth = Convert.ToInt32((currentWidth - widthImg)/2);
            int startHeight = Convert.ToInt32((currentHeight - heightImg) / 2);
            for (int i = 0; i < dataArray.Length; i++)
            {
                sld = pres.Slides[i];
                
                Image img = (Image)new Bitmap(LoadImage(dataArray[i]));
                IPPImage imgx = pres.Images.AddImage(img);
                sld.Shapes.AddPictureFrame(ShapeType.Rectangle, startWidth, startHeight, widthImg, heightImg, imgx);
                if(i != dataArray.Length - 1)
                    sld = pres.Slides.AddEmptySlide(pres.LayoutSlides[0]);
            }
            pres.Save(path, SaveFormat.Pptx);


            var rng = new Random();
            return Enumerable.Range(1, dataArray.Length).Select(index => new WeatherForecast
            {
                Date = DateTime.Now.AddDays(index),
                TemperatureC = rng.Next(-20, 55),
                Summary = Summaries[rng.Next(Summaries.Length)]
            })
            .ToArray();
        }
    }
}
